import React, { useState } from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";

const PageContainer = styled.div`
    display: flex;
    min-height: 100vh;
    width: 100vw;
    background: linear-gradient(135deg, #232526, #414345), url('video.mp4') no-repeat center center fixed;
    background-size: cover;
    padding: 20px;
    box-sizing: border-box;
    position: relative;
`;

const CardContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    gap: 20px;
    flex-wrap: wrap;
    width: 100%;
`;

const Card = styled.div`
    background: rgba(255, 255, 255, 0.1);
    padding: 30px;
    border-radius: 15px;
    backdrop-filter: blur(10px);
    box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.3);
    text-align: center;
    width: 300px;
    cursor: pointer;
    transition: 0.3s;
    color: white;

    &:hover {
        transform: scale(1.05);
        background: rgba(255, 255, 255, 0.2);
    }
`;

const Title = styled.h1`
    color: white;
    font-family: 'Montserrat', sans-serif;
    text-align: center;
    font-size: 2.5rem;
    margin-bottom: 20px;
`;

const StyledButton = styled(Link)`
    display: block;
    background: linear-gradient(135deg, #667eea, #5a67d8);
    color: white;
    padding: 12px 20px;
    text-align: center;
    border-radius: 5px;
    text-decoration: none;
    font-size: 18px;
    margin-top: 15px;
    transition: background 0.3s ease;

    &:hover {
        background: linear-gradient(135deg, #34d399, #10b981);
    }
`;

function AnalysisSelectionPage() {
    return (
        <PageContainer>
            <div>
                <Title>Select an Analysis</Title>
                <CardContainer>
                    <Card onClick={() => window.open('http://localhost:8501', '_blank')}>
                        <img src="https://source.unsplash.com/400x300/?technology" alt="Analysis 1" style={{ width: '100%', borderRadius: '10px' }} />
                        <h2>Analysis 1</h2>
                        <p>In-depth insights using AI and data analytics.</p>
                        <StyledButton to="#">Explore</StyledButton>
                    </Card>
                    <Card onClick={() => window.open('http://localhost:8502', '_blank')}>
                        <img src="https://source.unsplash.com/400x300/?business" alt="Analysis 2" style={{ width: '100%', borderRadius: '10px' }} />
                        <h2>Analysis 2</h2>
                        <p>Predictive modeling and anomaly detection.</p>
                        <StyledButton to="#">Explore</StyledButton>
                    </Card>
                </CardContainer>
            </div>
        </PageContainer>
    );
}

export default AnalysisSelectionPage;
